/**
 * @internal
 */
interface ICacheEngineStats {
    totalSize: number,
    nbCachedEntries: number,
    totalHits: 0,
    totalMisses: 0,
    cacheStats: Map<string, ICacheStats>
    groupedStats: Map<string, ICacheGroupStats>
}

/**
 * @internal
 */
interface ICacheStats {
    nbItems: number,
    size: number,
    statEntries: Map<string, ICacheStatsEntry>,
    hit: number,
    miss: number
}

/**
 * @internal
 */
interface ICacheGroupStats {
    nbEntries: number,
    totalSize: number,
    nbCachedEntries: number,
    totalHits: 0,
    totalMisses: 0
}